import React from 'react'
import './Blog.css'

let numberOfBlogs = 432;
function Blog() {
    return (
        <div className="blog-container">
            <div className="blog-title">
               <span className="blog-numbers">{numberOfBlogs}</span> IT блога
            </div>
        </div>
    )
}

export default Blog
